import { Dispatch, SetStateAction } from 'react';
import {ISymbol} from '../models/Data';

export default function CreateSearchResults(symbolsArray:Array<ISymbol>,content:string,setResults:Dispatch<SetStateAction<Array<ISymbol>>>){
    let tempResults:Array<ISymbol> = [];
    if(content.length === 0){
        setResults([]);
        return;
    }
    let contentToSearch = content.toUpperCase();
    let leng = symbolsArray.length;
    for(let i=0;i<leng;i++){
        let ISymbolElement = ISymbolsArray[i];
        if(ISymbolElement.notation[0] === contentToSearch[0] || ISymbolElement.description[0] === contentToSearch[0]){
            if(ISymbolElement.notation.includes(contentToSearch) || ISymbolElement.description.includes(contentToSearch)){
                tempResults.push(ISymbolElement);
            }
        }
    }
    setResults(tempResults);
}
